        </div>
        <div className="new-employee__control">
          <label>Street</label>
          <input
            type="text"
            value={enteredStreet}
            onChange={streetChangeHandler}
          />
        </div>
        <div className="new-employee__control">
          <label>City</label>
          <input type="text" value={enteredCity} onChange={cityChangeHandler} />
        </div>
        <div className="new-employee__control">
